    button : {
        marginTop : 20,

    }
})

const AskQuestion = () => {
const classes = useStyles();
    return (
        <div>
            <Typography  >Ask a question</Typography>
            <form className="form">
                <input className="form-input"  placeholder="Enter title" />
                <input className="form-input"  placeholder="Enter question"  />
